void Reset_MCM_Open( void ) {
  PrioMaskOn(MSK_CONFIGMCM);
}

int runreconf = 0;
int lastreconf = 0;
int ObjectMcM[] = {
  OBJ_MCMOBJ_1,
  OBJ_MCMOBJ_2,
  OBJ_MCMOBJ_3,
  OBJ_MCMOBJ_4,
  OBJ_MCMOBJ_5,
  OBJ_MCMOBJ_6
};

void StartConfUp(int numbermcm) {
  runreconf = numbermcm;
  lastreconf = numbermcm;
  SendToVisuObj(ObjectMcM[runreconf - 1], GS_TO_VISU_SET_ATTR_BLINK, 1);
  SendToVisuObj(ObjectMcM[0], GS_TO_VISU_SET_ATTR_GRABFOCUS, 0);
}

void OffConfUp( void ) {
  int offon = 0;
  int offnomin = 0;
  int onnomin = 0;
  if (runreconf > 0) {
    SendToVisuObj(OBJ_MCMOBJ_1, GS_TO_VISU_SET_ATTR_GRABFOCUS, 0);
    offon = 1;
    offnomin = 0;
  } else {
    onnomin = 0;
    SendToVisuObj(ObjectMcM[lastreconf - 1], GS_TO_VISU_SET_ATTR_BLINK, 0);
    SendToVisuObj(ObjectMcM[0], GS_TO_VISU_SET_ATTR_GRABFOCUS, 1);
    offon = 0;
  }
  for (int j = 0; j < GS_ARRAYELEMENTS(ObjectMcM); j++) {
    if (offnomin <= GS_ARRAYELEMENTS(ObjectMcM) && onnomin <= GS_ARRAYELEMENTS(ObjectMcM)) {
      SendToVisuObj(ObjectMcM[j], GS_TO_VISU_SET_ATTR_NOMINALFLAG, 1 - offon);
      onnomin++;
      offnomin++;
    }
  }
}
void Reset_MCM_Cycle(const tVisuData * VData, uint32_t evtc, tUserCEvt * evtv) {
  char stringinfo[25];
  for (uint32_t i = 0; i < evtc; i++) {
    if (CEVT_MENU_INDEX == evtv[i].Type) {
      uint32_t ObjId1 = evtv[i].Content.mMenuIndex.ObjID;
      for (int j = 0; j < GS_ARRAYELEMENTS(ObjectMcM); j++) {
        if (ObjectMcM[j] == ObjId1) {
          snprintf(stringinfo, GS_ARRAYELEMENTS(stringinfo), "%s%d%s", RCTextGetText(RCTEXT_T_CONFIGMCM, GetVarIndexed(IDX_SYS_LANGUAGE)), j + 1, "?");
          MsgBoxOkCancel(RCTextGetText(RCTEXT_T_INFO, GetVarIndexed(IDX_SYS_LANGUAGE)), stringinfo, StartConfUp, (j + 1), NULL, NULL);
        }
      }
    }
  }
  OffConfUp();
  Visu_HomeKeyPressed();
}

